import React from 'react';
import './About.css';
export default function About(){
    return(
        <>
        <div className="ab" id='ab'>
            <div className="school"><h2 className="ab-name">ईस मुहमम्द अन्सारी  कन्या  उ. मा.  विद्यालय</h2>
             <h4 className='loc'>जंगल लुअठहाँ , गोङरिया - कुशीनगर <br /> School code - 1294  || Establishment Year - 2010</h4></div>
             
             <h3 className="ab-des"> From Class 6th to class 10th <br />
             Recognized by Uttar Pradesh Government </h3>
             <div className="people">
                <h3 style={{marginBottom:"10px"}}>Director : Niyajuddin Ansari  [Mo.No. - 9984950054 | 8948302975] </h3>
                <h3>Principle : Najma Nesha (M.A. | B-Ed)</h3>
                <h3>Vice Principle : Khaliq Ansari (M.A. | D.L-Ed)</h3>
             </div>
        </div>
        </>
    )
}
